import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import EnrollListItem from '../enroll/EnrollListItem';


const ManageContainer = styled.div`
    background-color: #fff;
    width: 1200px;   
    height: 800px;
    display: flex;
    flex-direction: column;
    border-radius: 2px;
    box-shadow: 0px 5px 10px 1px #0004;
    padding: 0 30px 30px;
`;

const ManageHeader = styled.div`
    width: 100%;
    height: 70px;
    margin: 0 0 auto 0;
    position: relative;
    display: flex;
    align-items: center;
`;

const SubTitle = styled.h3`

`;

const EnrollUl = styled.ul`
    width: 100%;
    overflow: auto;
    height: 700px;
`;

const EnrollHead = styled.li`
    color: #fff;
    background-color: #aaf;
    padding: 4px 0;
    border-radius: 5px 5px 0 0;
    & ul {
        display: flex;
    }
    & > ul > li {
        text-align: center;
    }
`;

const EnrollNumber = styled.li`
    width: 60px;
`;

const EnrollTitle = styled.li`
    flex-grow: 1;
`;

const EnrollCreator = styled.li`
    width: 100px;
`;

const EnrollCreatedDate = styled.li`
    width: 100px;
`;

const EnrollDeadline = styled.li`
    width: 100px;
`;

const EnrollStatus = styled.li`
    width: 80px;
`;

const EnrollCount = styled.li`
    width: 70px;
`;

const EnrollAccess = styled.li`
    width: 70px;
`;

const PrevButton = styled.button`
    background-color: transparent;
    font-size: 20px;
    transition-duration: 0.5s;
    &:hover {
        transform: translateX(-2px);
        color: #aaf;
    }
`;

const StudyCountStatus = styled.h3`
    margin: 0 0 0 auto;
`

const DetailAllCloseButton = styled.button`
    margin: 0 0 0 20px;
    background-color: transparent;
    font-size: 20px;
    transition-duration: 0.5s;
    &:hover {
        transform: translateY(-2px);
        color: #aaf;
    }
`;

const ManageArea = () => {
    const [allFoldDetail, setAllFoldDetail] = useState(false);
    const navigate = useNavigate();
    const [notClosedCount, setNotClosedCount] = useState(null);
    const [studies, setStudies] = useState([]);
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        const getMemberData = () => {
            setLoading(true);
            try {
                axios.get("/api/members/my").then(response => {
                    console.log(response.data);
                }).catch(error => {
                    navigate('/');
                    alert('로그인이 필요합니다.');
                });
            } catch (e) {
                console.log(e);
            }
            setLoading(false);
        };
        const getNotClosedCount = () => {
            setLoading(true);
            try {
                axios.get("/api/studies/count").then(response => {
                    if (response.data.success === 0) {
                        setNotClosedCount(response.data.data.notClosedCount);
                    }
                }).catch(error => {
                    console.log(error);
                });
            } catch (e) {
                console.log(e);
            }
            setLoading(false);
        };
        const getStudyData = () => {
            setLoading(true);
            try {
                axios.get("/api/studies").then(response => {
                    if (response.data.success === 0) {
                        setStudies(response.data.data.studies);
                    }
                }).catch(error => {
                    console.log(error);
                });
            } catch (e) {
                console.log(e);
            }
            setLoading(false);
        }
        getMemberData();
        getNotClosedCount();
        getStudyData();
    }, []);

    if (loading) {
        return null;
    }

    return (
        <ManageContainer>
            <ManageHeader>
                <PrevButton onClick={() => navigate(-1)}><i className="fa-solid fa-arrow-left"></i></PrevButton>
                <StudyCountStatus>현재 개설한 스터디: {notClosedCount}</StudyCountStatus>
                <DetailAllCloseButton onClick={() => setAllFoldDetail(true)}><i className="fa-solid fa-folder-minus"></i></DetailAllCloseButton>
            </ManageHeader>
            <EnrollUl>
                <SubTitle>내가 개설한 스터디</SubTitle>
                <EnrollHead>
                    <ul>
                        <EnrollNumber>#</EnrollNumber>
                        <EnrollTitle>제목</EnrollTitle>
                        <EnrollCreator>개설자</EnrollCreator>
                        <EnrollCreatedDate>개설일</EnrollCreatedDate>
                        <EnrollDeadline>마감일</EnrollDeadline>
                        <EnrollStatus>상태</EnrollStatus>
                        <EnrollCount>인원</EnrollCount>
                        <EnrollAccess>신청</EnrollAccess>
                    </ul>
                </EnrollHead>
                {studies.map((study, index) => (
                    <EnrollListItem key={study.id} allFoldDetail={allFoldDetail} setAllFoldDetail={setAllFoldDetail} study={study} index={index+1} />
                ))}
            </EnrollUl>
        </ManageContainer>
    );
};

export default ManageArea;
